import React from "react";

const TaskList = ({ tasks, onDone }) => {
  return (
    <ul>
      {tasks.map((task) => (
        <li key={task.id}>
          <strong>{task.title}</strong> - {task.description}
          <button onClick={() => onDone(task.id)}>Done</button>
        </li>
      ))}
    </ul>
  );
};

export default TaskList;
